import React, { useState } from 'react';
import { AiOutlineClose, AiOutlineMenu } from 'react-icons/ai';

const Navbar = () => {
  const [nav, setNav] = useState(false);

  const handleNav = () => {
    setNav(!nav);
  };

  return (
    <div className='bg-white flex justify-between items-center max-w-[1400px] mx-auto h-24 px-2'>
      <h1 className='w-full text-3xl font-bold text-primary ml-4 text-cyan-600
      '>Hemant</h1>
      <ul className='hidden md:flex text-lg font-medium text-slate-600'>
        <li className='px-4 cursor-pointer hover:text-cyan-500 lg:px-5'>Home</li>
        <li className='px-4 cursor-pointer hover:text-cyan-500 lg:px-5'>About</li>
        <li className='px-4 cursor-pointer hover:text-cyan-500 lg:px-5'>Skills</li>
        <li className='px-4 cursor-pointer hover:text-cyan-500 lg:px-5'>Portfolio</li>
        <li className='px-4 cursor-pointer hover:text-cyan-500 lg:px-5'>Contact</li>
      </ul>
      <div onClick={handleNav} className='block md:hidden text-cyan-600 hover:border-solid border-4 border-cyan-600 rounded p-1'>
        {nav ? <AiOutlineClose size={26} /> : <AiOutlineMenu size={26} />}
      </div>
      <div className={nav ? 'fixed left-0 top-0 w-[70%] h-full bg-slate-100 border-r ease-in-out duration-500' : 'fixed left-[-100%]'}>
      <h1 className='text-3xl text-primary m-4 text-cyan-600 text-center font-medium'>Hemant</h1>
        <ul className='text-2xl text-cyan-700 p-4 font-medium'>

          <li className='px-2 py-3 cursor-pointer hover:text-white hover:bg-cyan-400 w-full text-center'>Home</li>
          <li className='px-2 py-3 cursor-pointer hover:text-white hover:bg-cyan-400 w-full text-center'>About</li>
          <li className='px-2 py-3 cursor-pointer hover:text-white hover:bg-cyan-400 w-full text-center'>Skills</li>
          <li className='px-2 py-3 cursor-pointer hover:text-white hover:bg-cyan-400 w-full text-center'>Portfolio</li>
          <li className='px-2 py-3 cursor-pointer hover:text-white hover:bg-cyan-400 w-full text-center'>Contact</li>
        </ul>
      </div>
    </div>
  );
}

export default Navbar;
